import React from "react";
import { Header, Form } from "semantic-ui-react";

import PageTemplate from "../Page_Template/PageTemplate";

export default function EmployeeDetails({
  form,
  handleFormFill,
  incrementStep,
  decrementStep,
}) {
  return (
    <PageTemplate>
      <Header>14. Employee Office Details</Header>
      <div>
        <Form>
          <Form.Group>
            <Form.Field
              control={Form.Input}
              label="Current Designation"
              name="current_designation"
              required
              onChange={(e) => {
                handleFormFill(
                  "employee_office_details",
                  "current_designation",
                  e.target.value
                );
              }}
              value={form["current_designation"]}
            />

            <Form.Field
              control={Form.Input}
              label="Current Post"
              name="current_post"
              required
              onChange={(e) => {
                handleFormFill(
                  "employee_office_details",
                  "current_post",
                  e.target.value
                );
              }}
              value={form["current_post"]}
            />
          </Form.Group>
        </Form>
      </div>
    </PageTemplate>
  );
}
